import React from 'react';

const HomePage: React.FC = () => (
  <div style={{ textAlign: 'center', marginTop: '2rem' }}>
    <h2>Explore Wikipedia</h2>
    <p>Use the navigation to discover and read articles.</p>
  </div>
);

export default HomePage;
